import React from "react";

class AdminPanel extends React.Component {
  render() {

    const inputType ={
      textColor: "white"
    }


    return (
      <div className="adminpanel col-md-4" >
        <form>
          <div className="form-group">
            <input type="text" placeholder="Nazwa ksiazki" id="bookNameInput" name="bookName" className="form-control"/>
          </div>
          <div className="form-group">
            <input type="text" placeholder="Autor" id="bookAuthorInput" name="bookAuthor" className="form-control"/>
          </div>
          <div className="form-group">
            <textarea  placeholder="Opis książki" id="bookDescriptionInput" name="bookDescription" className="form-control"/>
          </div>
          <div className="form-group">
            <label htmlFor="bookOnStock" className="form-check-label" style={inputType}>Dostępność: </label> 
            <input type="checkbox" placeholder="Dostęność książki" id="bookOnStock" name="bookOnStock" className="form-check"/>
          </div>
        </form>
      </div>
    );
  }
}

export default AdminPanel;
